#include<iostream>
#include<vector>
#include<queue>


using namespace std;

class Solution {
public:
    int longestOnes(vector<int>& A, int K) {

        int max_value = K;
        vector<int> combinedVec;
        for (int i = 0; i < A.size(); i++) {
            if (A[i] == 0) {
                //cout << "push zero " << i << endl;
                combinedVec.push_back(0);
            } else {
                if (i == 0 || A[i] != A[i-1])
                    combinedVec.push_back(0);
                combinedVec[combinedVec.size()-1] += 1;
                if (combinedVec[combinedVec.size()-1] > max_value)
                    max_value = combinedVec[combinedVec.size()-1];
            }
        }
        if (K == 0) {
            return max_value;
        }
        /*
        for(int i = 0; i < combinedVec.size(); i++) {
            cout << " " << combinedVec[i];
        }
        cout << endl;
        */

        queue<int> zero_q;
        queue<int> value_q;
        
        //int debug_zero_count = 0;       
        int value_q_value = 0;
        for (int i = 0; i < combinedVec.size(); i++) {
            if (combinedVec[i] == 0) {
                if (zero_q.size() < K) {
                    //cout << "xxxx i" << i  << "  size " << zero_q.size() << endl;
                    zero_q.push(i);
                    value_q_value += 1;
                    //debug_zero_count += 1;
                } else {
                    //cout << "zero_q_full i " << i << endl;
                    while(!value_q.empty() && value_q.front() < zero_q.front()) {
                        auto idx = value_q.front();
                        value_q_value -= combinedVec[idx];
                        //cout << "value_q_minus: " << value_q_value << endl;
                        value_q.pop();
                    }
                    zero_q.pop();
                    zero_q.push(i);
                }
            } else {
                //if ((!value_q.empty() && value_q.back() + 1 == i) || (!zero_q.empty() && zero_q.back() + 1 == i)) {
                    value_q.push(i);
                    value_q_value += combinedVec[i];
                    //cout << "value_q: " << combinedVec[i] << "value_q_value: " << value_q_value << endl;
                                    //}
            }
            if (value_q_value > max_value)
                max_value = value_q_value;

        }
        //cout << "zero_count " << debug_zero_count << endl;
        return max_value;
    }
};


